pragma solidity ^0.5.0;

contract Rideshare {
    address payee; // owner to receive payment
    address payer; // user to hire a car

    // struct Voter { // Struct
    //     uint weight;
    //     bool voted;
    //     address delegate;
    //     uint vote;
    // }

    struct Vehicle {
        string make;
        string model;
        string reg;
        uint price;
    }

    struct Owner {
        address addr;
        string name;
    }

    struct Driver {
        address addr;
        string name;
    }

    struct Rental {
        // uint rentalno;
        string reg;
        uint start_date;
        uint end_date;
        uint start_time;
        uint end_time;
    }

    // mapping to store the rentals
    mapping (uint => Rental) rentals;

    // mapping to store the vehicles
    mapping (uint => Vehicle) vehicles;

    // sequence number of rentals
    uint rentalseq;


    constructor (address _payer) public {
        payee = msg.sender;
        payer = _payer;
    }

    function hire(
        string memory reg, 
        uint start_date, 
        uint end_date, 
        uint start_time, 
        uint end_time
    ) public payable  {
        rentalseq++;

        rentals[rentalseq] = Rental(reg, start_date, end_date, start_time, end_time);
    }

    // event transaction(address buyer, string car)  {

    // }


    // function payment (address _payee) public {
    //     payee == msg.sender;
    // }


}
